import React, { Component } from 'react';
import classes from'./Header.module.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Preorders from '../../../Orders/order';
import BurgerBuilder from'../../../Container/BurgerBuilder/BurgerBuilder';
class Header extends Component{
 render(){
     return (
        <Router><div className={classes.header}>  
        Welcome To Order! 
        <a className={classes.label1}><Link to ="/">Burger Builder</Link> </a>
         <a className={classes.label2}> 
            <Link to ="/order"> Orders</Link>
        </a>
         <Route path="/order" ><Preorders/> </Route> 
         <Route path="/" children={<BurgerBuilder/>}> </Route> 
        </div> 
        </Router>
    )
 }
}
export default Header;
